import React, { Component } from "react";
import { connect } from "react-redux";
import { Segment, Container, Header } from "semantic-ui-react";
import { OrderDetailsSellerDecision } from "./OrderDetailsSellerDecision";

 class BuyNowForm extends Component {
  render() {
    return (
      <Container>
        <Segment>
          <Header as='h1'>Resell Item(s) on Platform as BuyNow</Header>
          <OrderDetailsSellerDecision
            urlOrderId={this.props.match.params.id}
            sellerDecision={"BuyNow"}
          />
        </Segment>
      </Container>
    );
  }
}

const mapState = (state) => ({});

const actionCreators = {};

const connectedBuyNowForm = connect(mapState, actionCreators)(BuyNowForm);

export { connectedBuyNowForm as BuyNowForm };
